function solution(lottos, win_nums) {
  function getRank(matches) {
    if (matches === 6) rank = 1;
    else if (matches === 5) rank = 2;
    else if (matches === 4) rank = 3;
    else if (matches === 3) rank = 4;
    else if (matches === 2) rank = 5;
    else rank = 6;

    return rank;
  }

  const matched = win_nums.filter((num) => lottos.includes(num));
  const unMatched = win_nums.filter((num) => !lottos.includes(num));
  const unknownLength = lottos.filter((num) => num === 0).length;

  const getHighest = () => {
    const matches = matched.length + Math.min(unMatched.length, unknownLength);
    return getRank(matches);
  };

  const getLowest = () => {
    const matches = matched.length + 0;
    return getRank(matches);
  };

  return [getHighest(), getLowest()];
}
